webpackJsonp([0xec5e3403771b],{8265:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"",date:"28 Jul 2006",slug:"/2006-07-28-wal-mart-says-tschuss/",tags:"Y2006"},html:'<p><a href="http://www.marketwatch.com/News/Story/Story.aspx?guid=%7BDD36AF44%2D9E8D%2D413A%2DBE18%2D3CEAB8861FB5%7D">Wal-Mart Stores to exit Germany</a> after 8 years, selling their 85 locations to the Metro Group and taking a $1 billion write-off. Their culture was alien to both employees and consumers, and they never grew big enough to compete with established discounters like Aldi.</p>\n<p><strong>Update</strong> There\'s a nice discussion (in German) on <a href="http://www.shopblogger.de/blog/archives/3922-Wal-Mart-zieht-sich-aus-Deutschland-zurueck.html">why Wal-Mart failed</a> at the <a href="http://www.shopblogger.de/blog/">Shopblogger</a>.</p>'},next:{fields:{title:"Money Quote",date:"27 Jul 2006",slug:"/2006-07-27-money-quote/"}},previous:{fields:{title:"Immersion",date:"01 Aug 2006",slug:"/2006-08-01-immersion/"}}},{node:{fields:{title:"Money Quote",date:"27 Jul 2006",slug:"/2006-07-27-money-quote/",tags:"Y2006"},html:'<blockquote>\n  There is nothing wrong with wanting to make money; that\'s just not why most people use communication tools.\n</p></blockquote>\n<p><a href="http://www.dashes.com/anil/2006/07/26/digga_please" title="Digga, Please! (Anil Dash)">Anil Dash</a> on weblogs and money, and he was even considerate enough to put this statement in bold so I wouldn\'t miss it.</p>'},next:{fields:{title:"Scaling the Pings",date:"26 Jul 2006",slug:"/2006-07-26-scaling-the-pings/"}},previous:{fields:{title:"",date:"28 Jul 2006",slug:"/2006-07-28-wal-mart-says-tschuss/"}}},{node:{fields:{title:"Scaling the Pings",date:"26 Jul 2006",slug:"/2006-07-26-scaling-the-pings/",tags:"Y2006"},html:'<p>Remember those <a href="http://www.papascott.de/archives/2006/07/19/dont-keep-knocking/">60000 pings per hour</a> I complained about last week? My colleague Lars said he wants them at <a href="http://85.114.159.59/">85.114.159.59</a> for <a href="http://usrportage.de/archives/661-Multithreaded-TCP-server-in-Ruby.html">some Ruby project</a> he\'s working on and is supposed to be ready "real soon now".</p>\n<p>Whatever he\'s doing, I hope it <a href="http://www.amazon.de/gp/product/0596102356">scales</a>.</p>'},next:{fields:{title:"I'm PapaScott, and you're not",date:"26 Jul 2006",slug:"/2006-07-26-im-papascott-and-youre-not/"}},previous:{fields:{title:"Money Quote",date:"27 Jul 2006",slug:"/2006-07-27-money-quote/"}}}],pathPrefix:"",first:!1,last:!1,index:202,pageCount:1101}}}});
